import React from "react"

function Food(props){ // same with Food({ fav })
  return(
    <div>I love {props.fav}</div>
  )
}
function App() {
  return (
    <div className="App">
      hello!!!!!
      <Food fav="potato"/>
      <Food fav="ramen"/>
      <Food fav="pizza"/>
    </div>
  );
}

export default App;
